    exercises = []
    for exercise in textbook.exercises:
        exercise_dump = exercise.exercise.model_dump()
        exercises.append(
            {
                "exerciseId": f"P{exercise.page}Ex{exercise.number}",
                "pageNumber": exercise.page,
                "exerciseNumber": exercise.number,
                "kind": "adapted",
                "studentAnswersStorageKey": hashlib.md5(
                    json.dumps(exercise_dump, separators=(",", ":"), indent=None).encode()
                ).hexdigest(),
                "adaptedExercise": exercise_dump,
            }
        )
    data = {"title": textbook.title, "exercises": exercises}

